<template>
    <div :class="`Login ${isFocus}`">
        <img class="logo" :src="require('@/assets/img/Login/logo.png')" alt="">
        <div class="loginBox">
            <!--<flexbox class="loginTab">-->
                <!--<flexbox-item align="center" @click.native="loginTab('Item1')">-->
                    <!--密码登录-->
                    <!--<img :class="Item1" :src="require('@/assets/img/Login/tab.png')" alt="">-->
                <!--</flexbox-item>-->
                <!--<flexbox-item align="center" @click.native="loginTab('Item2')">-->
                    <!--快捷登录-->
                    <!--<img :class="Item2" :src="require('@/assets/img/Login/tab.png')" alt="">-->
                <!--</flexbox-item>-->
            <!--</flexbox>-->
            <ul class="loginTabBox">
                <li :class="Item1 + ' loginTabBoxItem'">
                    <group class="login-group">
                        <x-input placeholder="手机号" @on-focus="focus" @on-blur="blur" class="login-x-input" :value="airforce.login.phone" @on-change="airforce.change.set($event,'phone','login')"></x-input>
                        <x-input placeholder="密码" @on-focus="focus" @on-blur="blur" type="password" class="login-x-input" :value="airforce.login.password" @on-change="airforce.change.set($event,'password','login')"></x-input>
                        <flexbox class="login-flexbox">
                            <flexbox-item class="left"><span @click="go('/Register')">新手注册</span></flexbox-item>
                            <flexbox-item class="right"><span @click="go('/ForgetPwd')">忘记密码</span></flexbox-item>
                        </flexbox>
                        <x-button class="login-x-button" @click.native="login">登录</x-button>
                    </group>
                </li>
                <li :class="Item2 + ' loginTabBoxItem'">
                    <group class="login-group">
                        <x-input placeholder="手机号" @on-focus="focus" @on-blur="blur" class="login-x-input" :value="airforce.login.phone" @on-change="airforce.change.set($event,'phone','login')"></x-input>
                        <z-input placeholder="短信验证码" @on-focus="focus" @on-blur="blur" class="login-x-input" :value="airforce.login.code" @change="airforce.change.set($event,'code','login')" @click="getCode" :disabled-btn="airforce.login.disabledBtn" field-name="login"></z-input>
                        <flexbox class="login-flexbox">
                            <flexbox-item class="left"><span @click="go('/Register')">新手注册</span></flexbox-item>
                            <flexbox-item class="right"><span @click="go('/ForgetPwd')">忘记密码</span></flexbox-item>
                        </flexbox>
                        <x-button class="login-x-button" @click.native="login">登录</x-button>
                    </group>
                </li>
                <li>
                    <div class="loginBottom">
                        <div class="iconfont" @click="go('/AccountAppeal')">其他登录问题&#xe608;</div>
                        <div class="iconfont">使用以下方式登录</div>
                        <flexbox class="login-flexbox">
                            <flexbox-item class="right"><span class="iconfont">&#xe660;</span></flexbox-item>
                            <flexbox-item class="left"><span class="iconfont">&#xe601;</span></flexbox-item>
                        </flexbox>
                    </div>
                </li>
            </ul>
        </div>
    </div>
</template>

<script>
    import { Flexbox, FlexboxItem, XInput, XButton, Group } from "vux"
    import { ZInput } from "@/components"
    import { mapGetters, mapActions } from "vuex"
    export default {
        name: "login",
        components:{
            ZInput,
            Flexbox, FlexboxItem, XInput, XButton, Group, ZInput },
        data(){
            return {
                Item1:'select',
                Item2:'',
                isFocus:'',
            }
        },
        methods:{
            ...mapActions(['action']),
            loginTab(type){
                if(type == "Item1"){
                    this.Item1 = "select";
                    this.Item2 = "";
                }
                if(type == "Item2"){
                    this.Item2 = "select";
                    this.Item1 = "";
                }
            },
            getCode(next){
                if(!this.airforce.login.phone || this.$utils.is_S(this.airforce.login.phone)){
                    this.$vux.toast.text("【手机号】不能为空");
                    return;
                }
                if(!this.$utils.isPhone(this.airforce.login.phone)){
                    this.$vux.toast.text("【手机号】格式错误");
                    return;
                }
                this.action({
                    moduleName:"getcode",
                    url:'api/member/getcode',
                    method:'post',
                    isFormData:true,
                    data:{
                        phone:this.airforce.login.phone
                    }
                }).then(res=>{
                    if(res.code != 200){
                        this.$vux.toast.text(res.message);
                        return;
                    }
                    this.action({
                        moduleName:"login",
                        goods:{
                            code:res.data.code_name
                        }
                    });
                }).catch(err=>{
                    this.$vux.toast.text(err);
                });
                next({
                    fieldName:"login"
                })
            },
            login(){
                if(!this.airforce.login.phone || this.$utils.is_S(this.airforce.login.phone)){
                    this.$vux.toast.text("【手机号】不能为空");
                    return;
                }
                if(!this.$utils.isPhone(this.airforce.login.phone)){
                    this.$vux.toast.text("【手机号】格式错误");
                    return;
                }

                if(this.Item2 == "select"){
                    if(!this.airforce.login.code || this.$utils.is_S(this.airforce.login.code)){
                        this.$vux.toast.text("【短信验证码】不能为空");
                        return;
                    }
                }else {
                    if(!this.airforce.login.password || this.$utils.is_S(this.airforce.login.password)){
                        this.$vux.toast.text("【密码】不能为空");
                        return;
                    }
                    if(this.airforce.login.password.length < 6){
                        this.$vux.toast.text("【密码】长度至少为6位及以上字符");
                        return;
                    }
                };
                let url = '/member/login';
                if(this.Item2 == 'select'){
                    //快捷登录
                    url = 'adminapi/member/quicklogin';
                }
                this.$vux.loading.show({text: '登陆中..'});
                this.action({
                    moduleName:"login_post",
                    url:url,
                    method:'post',
                    isFormData:true,
                    data:this.airforce.login
                }).then(res=>{
                    if(res.code != 200){
                        this.$vux.toast.text(res.message);
                        return;
                    };
                    this.$vux.toast.text('登陆成功');
                    localStorage.login_post = JSON.stringify(res);
                    this.action({
                        moduleName:"prefectInfo",
                        goods:res.data
                    });
                    this.$utils.SearchParentKey(this.$parent,"initConfig").value();
                    this.$router.push("/Home");
                }).catch(err=>{
                    this.$vux.toast.text(err);
                });
            },
            go(name){
                this.$router.push(name);
            },
            focus(){
                this.isFocus = 'loginTabBox-focus';
            },
            blur(){
                this.isFocus = '';
            }
        },
        computed:{
            ...mapGetters(['airforce'])
        },
        mounted(){
            this.plus.then(plus=>{
                plus.navigator.setFullscreen( true );
            });
        }
    }
</script>

